import React from "react";

interface DataItem {
    id: string;
    app: string;
    name: string;
    supported_triggers: string;
    all_changes_deployed: string;
  }

  interface TableContainerProps {
    data: DataItem[];
  }

const Table: React.FC<TableContainerProps> = ({ data }) => {
    return (
    <div>
        <p>Table Container</p>
        <table>
            <thead>
                <tr>
                <th>Application</th>
                <th>Action</th>
                <th>Trigger</th>
                <th>Status</th>
                </tr>
            </thead>
            <tbody>
              {data.map(item => (
                <tr key={item.id}>
                  <td>item.app</td>
                  <td>{item.name}</td>
                  <td>{item.supported_triggers}</td>
                  <td>{item.all_changes_deployed}</td>
                </tr>
              ))}
            </tbody>
        </table>
    </div>
    );
};

export default Table;
